We start with a main function that parses command-line options, and invokes the appropriate role-specific service. After a prelude of imports, we start by defining a Rust enum for the Roles that the service supports. use clap::{Parser, ValueEnum};
use client::run_client;
use hydroflow::tokio;
use hydroflow::util::{bind_udp_bytes, ipv4_resolve};
use server::run_server;
use std::net::SocketAddr; mod client;
mod helpers;
mod protocol;
mod server; #[derive(Clone, ValueEnum, Debug)]
enum Role { Client, Server,
} Following that, we use Rust's clap (Command Line Argument Parser) crate to parse command-line options: #[derive(Parser, Debug)]
struct Opts { #[clap(value_enum, long)] role: Role, #[clap(long, value_parser = ipv4_resolve)] addr: Option<SocketAddr>, #[clap(long, value_parser = ipv4_resolve)] server_addr: Option<SocketAddr>,
} This sets up 3 command-line flags: role, addr, and server_addr. Note how the addr and server_addr flags are made optional via wrapping in a Rust Option; by contrast, the role option is required. The clap crate will parse the command-line options and populate the Opts struct with the values. clap handles parsing the command line strings into the associated Rust types -- the value_parser attribute tells clap to use Hydroflow's ipv4_resolve helper function to parse a string like "127.0.0.1:6552" into a SocketAddr. This brings us to the main function itself. It is prefaced by a #[tokio::main] attribute, which is a macro that sets up the tokio runtime. This is necessary because Hydroflow uses the tokio runtime for asynchronous execution as a service. #[tokio::main]
async fn main() { // parse command line arguments let opts = Opts::parse(); // if no addr was provided, we ask the OS to assign a local port by passing in "localhost:0" let addr = opts .addr .unwrap_or_else(|| ipv4_resolve("localhost:0").unwrap()); // allocate `outbound` sink and `inbound` stream let (outbound, inbound, addr) = bind_udp_bytes(addr).await; println!("Listening on {:?}", addr); After parsing the command line arguments we set up some Rust-based networking. Specifically, for either client or server roles we will need to allocate a UDP socket that is used for both sending and receiving messages. We do this by calling the async bind_udp_bytes function, which is defined in the hydroflow/src/util module. As an async function it returns a Future, so requires appending .await; the function returns a triple of type (UdpSink, UdpSource, SocketAddr). The first two are the types that we'll use in Hydroflow to send and receive messages, respectively. (Note: your IDE might expand out the UdpSink and UdpSource traits to their more verbose definitions. That is fine; you can ignore those.) The SocketAddr is there in case you specified port 0 in your addr argument, in which case this return value tells you what port the OS has assigned for you. All that's left is to fire up the code for the appropriate role! match opts.role { Role::Server => { run_server(outbound, inbound, opts).await; } Role::Client => { run_client(outbound, inbound, opts).await; } }
}

