The chat client is not very different from the echo server client, with two new design patterns: a degenerate source_iter pipeline that runs once as a "bootstrap" in the first tick the use of cross_join as a "gated buffer" to postpone sending messages. We also include a Rust helper routine pretty_print_msg for formatting output. The prelude of the file is almost the same as the echo server client, with the addition of a crate for handling colored text output. This is followed by the pretty_print_msg function, which is fairly self-explanatory. To follow along, start by replacing the contents of src/client.rs with the following: use crate::protocol::Message;
use crate::{GraphType, Opts};
use chrono::prelude::*;
use hydroflow::hydroflow_syntax;
use hydroflow::util::{UdpSink, UdpStream}; use chrono::Utc;
use colored::Colorize; fn pretty_print_msg(msg: Message) { if let Message::ChatMsg { nickname, message, ts, } = msg { println!( "{} {}: {}", ts.with_timezone(&Local) .format("%b %-d, %-I:%M:%S") .to_string() .truecolor(126, 126, 126) .italic(), nickname.green().italic(), message, ); }
} This brings us to the run_client function. As in run_server we begin by ensuring the server address is supplied. We then have the hydroflow code starting with a standard pattern of a merged outbound_chan, and a demuxed inbound_chan. The client handles only two inbound Message types: Message::ConnectResponse and Message::ChatMsg. Paste the following to the bottom of src/client.rs: pub(crate) async fn run_client(outbound: UdpSink, inbound: UdpStream, opts: Opts) { // server_addr is required for client let server_addr = opts.server_addr.expect("Client requires a server address"); println!("Client live!"); let mut hf = hydroflow_syntax! { // set up channels outbound_chan = merge() -> dest_sink_serde(outbound); inbound_chan = source_stream_serde(inbound) -> map(|(m, _)| m) -> demux(|m, var_args!(acks, msgs, errs)| match m { Message::ConnectResponse => acks.give(m), Message::ChatMsg {..} => msgs.give(m), _ => errs.give(m), } ); inbound_chan[errs] -> for_each(|m| println!("Received unexpected message type: {:?}", m)); The core logic of the client consists of three dataflow pipelines shown below. Paste this into the bottom of your src/client.rs file. // send a single connection request on startup source_iter([()]) -> map(|_m| (Message::ConnectRequest, server_addr)) -> [0]outbound_chan; // take stdin and send to server as a msg // the cross_join serves to buffer msgs until the connection request is acked msg_send = cross_join() -> map(|(msg, _)| (msg, server_addr)) -> [1]outbound_chan; lines = source_stdin() -> map(|l| Message::ChatMsg { nickname: opts.name.clone(), message: l.unwrap(), ts: Utc::now()}) -> [0]msg_send; inbound_chan[acks] -> [1]msg_send; // receive and print messages inbound_chan[msgs] -> for_each(pretty_print_msg); }; The first pipeline is the "bootstrap" alluded to above. It starts with source_iter operator that emits a single, opaque "unit" (()) value. This value is available when the client begins, which means this pipeline runs once, immediately on startup, and generates a single ConnectRequest message which is sent to the server. The second pipeline reads from source_stdin and sends messages to the server. It differs from our echo-server example in the use of a cross_join with inbound_chan[acks]. This cross-join is similar to that of the server: it forms pairs between all messages and all servers that send a ConnectResponse ack. In principle this means that the client is broadcasting each message to all servers. In practice, however, the client establishes at most one connection to a server. Hence over time, this pipeline starts with zero ConnectResponses and is sending no messages; subsequently it receives a single ConnectResponse and starts sending messages. The cross_join is thus effectively a buffer for messages, and a "gate" on that buffer that opens when the client receives its sole ConnectResponse. The final pipeline simply pretty-prints the messages received from the server. Finish up the file by pasting the code below for optionally generating the graph and running the flow: // optionally print the dataflow graph if let Some(graph) = opts.graph { let serde_graph = hf .meta_graph() .expect("No graph found, maybe failed to parse."); match graph { GraphType::Mermaid => { println!("{}", serde_graph.to_mermaid()); } GraphType::Dot => { println!("{}", serde_graph.to_dot()) } GraphType::Json => { unimplemented!(); } } } hf.run_async().await.unwrap();
